import React, { Component } from "react";
import { fetchUserRentals } from "../../actions/";
import { connect } from "react-redux";

class RentalManage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      userRentals: [],
      errors: [],
      isFetching: false
    };
  }

  componentDidMount() {
    // this.props
    //   .fetchUserRentals()
    //   .then(userRentals => this.setState({ userRentals }))
    //   .catch(errors => this.setState({ errors }));
    actions.fetchUserRentals().then(
      userRentals => this.setState({ userRentals, isFetching: false }),
      errors => this.setState({ errors, isFetching: false })
    );
  }

  render() {
    const { isAuthenticated } = this.props.auth;
    const { userRentals } = this.state;
    return (
      <div>
        {isAuthenticated && (
          <div>
            {userRentals.map((rental, i) => (
              <p key={i}>{rental.title}</p>
            ))}
          </div>
        )}
      </div>
    );
  }
}

const mapStateToProps = state => ({
  auth: state.auth
});

export default connect(mapStateToProps)(RentalManage);
